import React, {Component} from "react";
import { AxiosContext } from "react-axios/lib/components/AxiosProvider";
import { ApiurlUsers } from "../services/apirest";
import axios from "axios";
import Header from "../template/Header";




class Editar extends Component{


    componentDidMount(){
        let UserEmail = this.props.match.params.id;  
        let url = ApiurlUsers +"/"+  UserEmail; 
        axios.get(url)
        .then( response => {
            console.log(response);
            
         });
    }


    render(){
        return(
               
            <React.Fragment>

            <Header/>

            <div className="container">
                    <h3>Editar Usuario </h3>
            </div>



            <div className="container">
              <br/>
              <form className="form horizontal">
                <div className="row">
                     <div className="col-sm-12">
                    <label className="col-md-2 control-label">Nombre</label>
                    <div className="col-md-10">
                        <input className="form-control" name="nombre" placeholder="Nombre" type="text"/>
                      </div>
               </div>
                </div>


            


              </form>
            </div>




            </React.Fragment>
        
               
        );
    }

}


export default Editar;
